import * as React from 'react';
import Paper from '@mui/material/Paper';
import {
  Scheduler,
  WeekView,
  Appointments,
  AppointmentTooltip,
  AppointmentForm,
  Toolbar,
  DateNavigator,
  ViewSwitcher,
  MonthView,
  DayView,
} from '@devexpress/dx-react-scheduler-material-ui';

import appointments from './today-appointments';
import { ViewState } from '@devexpress/dx-react-scheduler';

export default class Demo extends React.PureComponent {
  constructor(props) {
    super(props);
    this.state = {
      data: appointments,
    };
  }

  render() {
    const { data } = this.state;

    return (
      <Paper>
        <Scheduler
          data={data}
          height={660}
        >
        <ViewState/>
        <DayView>
            startDayHour={9}
            endDayHour={19}
        </DayView>
        <WeekView
            startDayHour={9}
            endDayHour={19}
        />
          <MonthView/>
          <Toolbar/>
          <ViewSwitcher/>

          <Appointments />
          <AppointmentTooltip
            showCloseButton
            showOpenButton
          />
          <AppointmentForm
            readOnly
          />
        </Scheduler>
      </Paper>
    );
  }
}
